				<div class="entry-content">
			<p>It&#8217;s battle rap time, using an app called &#8220;AutoRap&#8221; by Smule. The guys face off against each other to see who has more LA street cred and ultimately more turf. I&#8217;ve included the &#8220;dry&#8221; vocals (pre AutoRap) as well as the final &#8220;wet&#8221; (post AutoRap) audio just so you get the idea. Sounds like they&#8217;re looking for people to challenge Ellis (or I&#8217;m guessing anyone on the show) to a rap battle, so if you feel so inclined, download the app, make your rap and submit it to the show through the regular channels. I&#8217;m also assuming @CassetteCoast is prohibited as he&#8217;s already <a href="http://noyouare.lixlink.com/2013/07/meet-the-guy-that-verbally-murdered-the-entire-jason-ellis-show-crew/">systematically destroyed the entire show</a> several times over.</p>
