	<article id="post-15484" class="post-15484 post type-post status-publish format-standard hentry category-overview tag-audio tag-cumfat tag-jason-ellis tag-mike-tully tag-pineapple tag-rawdog tag-schumacher tag-stretch tag-will-pendarvis">
		<header class="entry-header">
						<h1 class="entry-title"><a href="http://noyouare.lixlink.com/2016/01/creepy-weekend-contest/" rel="bookmark">Creepy Weekend Contest</a></h1>
			
						<div class="entry-meta">
				<span class="sep">Posted on </span><a href="http://noyouare.lixlink.com/2016/01/creepy-weekend-contest/" title="9:20 PM" rel="bookmark"><time class="entry-date" datetime="2016-01-05T21:20:11+00:00">January 5, 2016</time></a><span class="by-author"> <span class="sep"> by </span> <span class="author vcard"><a class="url fn n" href="http://noyouare.lixlink.com/author/bitPimps/" title="View all posts by bitPimps 中" rel="author">bitPimps 中</a></span></span>			</div><!-- .entry-meta -->
			
					</header><!-- .entry-header -->

				<div class="entry-content">
			<div id="attachment_15495" style="width: 234px" class="wp-caption alignright"><a href="http://noyouare.lixlink.com/wp-content/uploads/2016/01/schumacher-disney-princesses.jpg" target="_blank" rel="attachment wp-att-15495"><img class="wp-image-15495 size-medium" src="http://noyouare.lixlink.com/wp-content/uploads/2016/01/schumacher-disney-princesses-224x300.jpg" alt="schumacher-disney-princesses" width="224" height="300" srcset="http://noyouare.lixlink.com/wp-content/uploads/2016/01/schumacher-disney-princesses-224x300.jpg 224w, http://noyouare.lixlink.com/wp-content/uploads/2016/01/schumacher-disney-princesses.jpg 478w" sizes="(max-width: 224px) 100vw, 224px" /></a><p class="wp-caption-text">Schumacher in his glory.</p></div>
<p>This nostalgic and entertaining clip from 2011 is a classic example of just how good the show was with little to no professional support, no professional producer, and literally flying by the seat the of their pants. The contest was for everyone to do something &#8220;creepy&#8221; over the weekend and anonymously write down what they did. Everyone was then tasked with guessing who did what as each instance was read. It wasn&#8217;t only hilarious, but in hind sight, it gave us an introduction into Will&#8217;s world. Little did anyone realize the door that was left cracked open would eventually allow the escape for more stories and a one-man band fueled with a plethora of songs &#8211; HATEBEAN! Will wasn&#8217;t the only one with a disturbingly hilarious entry in the contest though, intern Schumacher also revealed what could only be described as a perverted, depraved, sexual fetish that might scare the average person &#8211; but not the average Jason Ellis Show listener. And of course Rawdog&#8217;s entry involved nipple play &#8211; no spoiler alert required. Enjoy.</p>
