	<article id="post-15478" class="post-15478 post type-post status-publish format-standard hentry category-overview tag-audio tag-jason-ellis tag-kevin-james tag-mall-cop tag-mike-tully">
		<header class="entry-header">
						<h1 class="entry-title"><a href="http://noyouare.lixlink.com/2016/01/kevin-james-calls-in-to-promote-mall-cop-rare-audio/" rel="bookmark">Kevin James Calls In To Promote &#8220;Mall Cop&#8221; (Rare Audio)</a></h1>
			
						<div class="entry-meta">
				<span class="sep">Posted on </span><a href="http://noyouare.lixlink.com/2016/01/kevin-james-calls-in-to-promote-mall-cop-rare-audio/" title="7:19 PM" rel="bookmark"><time class="entry-date" datetime="2016-01-01T19:19:27+00:00">January 1, 2016</time></a><span class="by-author"> <span class="sep"> by </span> <span class="author vcard"><a class="url fn n" href="http://noyouare.lixlink.com/author/bitPimps/" title="View all posts by bitPimps 中" rel="author">bitPimps 中</a></span></span>			</div><!-- .entry-meta -->
			
					</header><!-- .entry-header -->

				<div class="entry-content">
			<p>This clip from 2009 is rarely played as there&#8217;s not a lot of non-stop &#8220;funny&#8221; or show defining content to it, but it is still very interesting and cool to hear. Kevin James calls in to promote Mall Cop and trade a few friendly verbal jabs with Ellis. And one has to assume this interview only happened because Ellis had a small part in the movie, as nobody at Sirius XM was actually tasked with booking high profile guests for the show back then. It&#8217;s also a nice throw back to the early days of The Jason Ellis Show, which is always fun to hear. Enjoy.</p>
